import classes from './Home.css';
import Button from '@mui/material/Button';

function Home() {
  return (
    <>
      <h1>Welcome to Best-Fit Colleges</h1> 
      <div class = {classes.button}>
        <Button variant="contained">Tab 1</Button>
        <Button variant="contained">Tab 2</Button>
      </div>
    </>
  );
}

export default Home;
